import React from "react";
import Machine from "./Machine";
function MG(prop){
    
   let mgarray=()=> prop.mg.map(function(ele){
    return console.log("mg"+ele.id);
    
   })
   mgarray();
    return(
        <div className="MG">
           
            {
                prop.mg.map(function(ele){
                    return( <Machine machine={ele.machines}/>)
                })
                
            }     
            
        </div>
    )
}
export default MG;
